import React, { Component } from 'react';
import './App.css';
import { render } from 'react-dom'
import { ResponsiveBar } from '@nivo/bar'

const data = [
  {
    "value": "very_educated", 
    "percent": 45,
    "percentColor": "#000000",
  },
  {
    "value": "somewhat_educated", 
    "percent": 26,
    "percentColor": "#000000",
  },
  {
    "value": "not_too_educated", 
    "percent": 13,
    "percentColor": "#000000",
  },
  {
    "value": "not_at_all_educated", 
    "percent": 15,
    "percentColor": "#000000",
  },
]

class App extends Component {
  render() {
    return (
      <div className="App" height="900px">
        <ResponsiveBar
          data = {data}
          indexBy="value"
          keys={[
            "percent",
          ]}
          margin={{
            "top": 50,
            "right": 130,
            "bottom": 50,
            "left": 60
          }}
          padding={0.2}
          labelTextColor="inherit:darker(1.4)"
          labelSkipWidth={16}
          labelSkipHeight={16}
          groupMode="grouped"
        />
      </div>
    );
  }
}

export default App;
